import React from 'react';

const ClassSchedule = () => {
    return (
        <div className="class-schedule card">
            <h3>Lớp học phần</h3>
            <select>
                <option>2024 - 2025</option>
            </select>
            <div className="schedule-stats">
                <p><strong>Môn học/lớp phần:</strong> 100090303</p>
                <p><strong>Thuộc lớp cũ khối ngành CNTT:</strong> 011100153681</p>
                <p><strong>Lịch sử Đăng ký sẵn Việt Nam:</strong> 011100136701</p>
                <p><strong>Tổng số tín chỉ đăng ký:</strong> 5</p>
                <p><strong>Tổng số tín chỉ đã hoàn thành:</strong> 2</p>
                <p><strong>Tổng số tín chỉ chưa hoàn thành:</strong> 3</p>
            </div>
        </div>
    );
};

export default ClassSchedule;
